INSERT INTO `categories` (`category_id`, `title`, `discripition`) VALUES
(2, 'Launchers', 'FireQuick Launcher IIIs are multi-round, 22-caliber modified starter pistols. Large Format Launchers have been specially designed to project a large format flare 250-300’ from the user.'),
(3, 'Flares', 'All Firequick flares are designed to be rugged and provide high-performance, dynamic ignition capability. All flares burn at an unprecedented 4000° F, and once lit will burn even under water.'),
(4, 'Firequick Accessories', 'This 9-round cylinder fits the FireQuick Launchers I and II only.  A handy item to have for quick reloading and firing.'),
(5, 'Kits and Combos', 'Combination of items to help you get a bigger bang for your buck.'),
(6, 'Wiley X Tactical Eyewear and Gloves', 'ANSI Z87 rated premium safety / sunglasses exceeding OSHA standards. Gloves offer the ultimate in flame resistant hand protection while allowing for maximum dexterity.');
