(34, 'Terms of Use', '&lt;p&gt;&lt;strong&gt;TERMS OF USE AGREEMENT&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;This Terms of Use Agreement (“Agreement”) constitutes a legally binding agreement made between you, whether personally or on behalf of an entity (“user” or “you”) and Firequick Products, Inc. and its affiliated companies (collectively, “Company” or “we” or “us” or “our”), concerning your access to and use of the http://www.firequick.com website as well as any other media form, media channel, mobile website or mobile application related or connected thereto (collectively, the “Website”). The Website provides the following service: eCommerce and business/product information (“Company Services”). Supplemental terms and conditions or documents that may be posted on the Website from time to time, are hereby expressly incorporated into this Agreement by reference.&lt;/p&gt;\n\n&lt;p&gt;&lt;br&gt;\nCompany makes no representation that the Website is appropriate or available in other locations other than where it is operated by Company. The information provided on the Website is not intended for distribution to or use by any person or entity in any jurisdiction or country where such distribution or use would be contrary to law or regulation or which would subject Company to any registration requirement within such jurisdiction or country. Accordingly, those persons who choose to access the Website from other locations do so on their own initiative and are solely responsible for compliance with local laws, if and to the extent local laws are applicable.&lt;/p&gt;\n\n&lt;p&gt;All users who are minors in the jurisdiction in which they reside (generally under the age of 18) are not permitted to register for the Website or use the Company Services.&lt;/p&gt;\n\n&lt;p&gt;&lt;br&gt;\nYOU ACCEPT AND AGREE TO BE BOUND BY THIS AGREEMENT BY ACKNOWLEDGING SUCH ACCEPTANCE DURING THE REGISTRATION PROCESS (IF APPLICABLE) AND ALSO BY CONTINUING TO USE THE WEBSITE. IF YOU DO NOT AGREE TO ABIDE BY THIS AGREEMENT, OR TO MODIFICATIONS THAT COMPANY MAY MAKE TO THIS AGREEMENT IN THE FUTURE, DO NOT USE OR ACCESS OR CONTINUE TO USE OR ACCESS THE COMPANY SERVICES OR THE WEBSITE.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;PURCHASES; PAYMENT&lt;/strong&gt;&lt;br&gt;\nCompany bills you through an online billing account for purchases of products and/or services. You agree to pay Company all charges at the prices then in effect for the products you or other persons using your billing account may purchase, and you authorize Company to charge your chosen payment provider for any such purchases. You agree to make payment using that selected payment method. If you have ordered a product or service that is subject to recurring charges then you consent to our charging your payment method on a recurring basis, without requiring your prior approval from you for each recurring charge until such time as you cancel the applicable product or service. Company reserves the right to correct any errors or mistakes in pricing that it makes even if it has already requested or received payment. Sales tax will be added to the sales price of purchases as deemed required by Company. Company may change prices at any time. All payments shall be in U.S. dollars.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;RETURN POLICY&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Please review our Return Policy posted on our Website prior to making any purchases.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;USER REPRESENTATIONS&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;Regarding Your Registration&lt;/strong&gt;&lt;/em&gt;&lt;br&gt;\nBy using the Company Services, you represent and warrant that:&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1.&lt;/strong&gt;all registration information you submit is truthful and accurate.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;you will maintain the accuracy of such information.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;you will keep your password confidential and will be responsible for all use of your password and accoun.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;you are not a minor in the jurisdiction in which you reside, or if a minor, you have received parental permission to use this Website.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;and your use of the Company Services does not violate any applicable law or regulation.&lt;/p&gt;\n\n&lt;p&gt;You also agree to: (a) provide true, accurate, current and complete information about yourself as prompted by the Website’s registration form and (b) maintain and promptly update registration data to keep it true, accurate, current and complete. If you provide any information that is untrue, inaccurate, not current or incomplete, or Company has reasonable grounds to suspect that such information is untrue, inaccurate, not current or incomplete, Company has the right to suspend or terminate your account and refuse any and all current or future use of the Website (or any portion thereof).&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;Regarding Content You Provide&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;The Website may invite you to chat or participate in blogs, message boards, online forums and other functionality and may provide you with the opportunity to create, submit, post, display, transmit, perform, publish, distribute or broadcast content and materials to Company and/or to or via the Website, including, without limitation, text, writings, video, audio, photographs, graphics, comments, suggestions or personally identifiable information or other material (collectively &quot;Contributions&quot;). Any Contributions you transmit to Company will be treated as non-confidential and non-proprietary. When you create or make available a Contribution, you thereby represent and warrant that:&lt;/p&gt;\n\n&lt;p&gt;the creation, distribution, transmission, public display and performance, accessing, downloading and copying of your Contribution does not and will not infringe the proprietary rights, including but not limited to the copyright, patent, trademark, trade secret or moral rights of any third party.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1.&lt;/strong&gt;you are the creator and owner of or have the necessary licenses, rights, consents, releases and permissions to use and to authorize Company and the Website users to use your Contributions as necessary to exercise the licenses granted by you under this Agreement.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;you have the written consent, release, and/or permission of each and every identifiable individual person in the Contribution to use the name or likeness of each and every such identifiable individual person to enable inclusion and use of the Contribution in the manner&lt;br&gt;\ncontemplated by this Website&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;your Contribution is not obscene, lewd, lascivious, filthy, violent, harassing or otherwise objectionable (as determined by Company), libelous or slanderous, does not ridicule, mock, disparage, intimidate or abuse anyone, does not advocate the violent overthrow of any&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;government, does not incite, encourage or threaten physical harm against another, does not violate any applicable law, regulation, or rule, and does not violate the privacy or publicity rights of any third party&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;your Contribution does not contain material that solicits personal information from anyone under 18 or exploit people under the age of 18 in a sexual or violent manner, and does not&lt;br&gt;\nviolate any federal or state law concerning child pornography or otherwise intended to protect the health or well-being of minors&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;6.&lt;/strong&gt;your Contribution does not include any offensive comments that are connected to race, national origin, gender, sexual preference or physical handicap&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;7.&lt;/strong&gt;your Contribution does not otherwise violate, or link to material that violates, any provision of this Agreement or any applicable law or regulation.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;CONTRIBUTION LICENSE&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;By posting Contributions to any part of the Website, or making them accessible to the Website by linking your account to any of your social network accounts, you automatically grant, and you represent and warrant that you have the right to grant, to Company an unrestricted, unconditional, unlimited, irrevocable, perpetual, non-exclusive, transferable, royalty-free, fully-paid, worldwide right and license to host, use, copy, reproduce, disclose, sell, resell, publish, broadcast, retitle, archive, store, cache, publicly perform, publicly display, reformat, translate, transmit, excerpt (in whole or in part) and distribute such Contributions (including, without limitation, your image and voice) for any purpose, commercial, advertising, or otherwise, to prepare derivative works of, or incorporate into other works, such Contributions, and to grant and authorize sublicenses of the foregoing. The use and distribution may occur in any media formats and through any media channels. Such use and distribution license will apply to any form, media, or technology now known or hereafter developed, and includes our use of your name, company name, and franchise name, as applicable, and any of the trademarks, service marks, trade names and logos, personal and commercial images you provide. Company does not assert any ownership over your Contributions; rather, as between us and you, subject to the rights granted to us in this Agreement, you retain full ownership of all of your Contributions and any intellectual property rights or other proprietary rights associated with your Contributions.&lt;/p&gt;\n\n&lt;p&gt;Company has the right, in our sole and absolute discretion, to (i) edit, redact or otherwise change any Contributions, (ii) re-categorize any Contributions to place them in more appropriate locations or (iii) pre- screen or delete any Contributions that are determined to be inappropriate or otherwise in violation of this Agreement.&lt;/p&gt;\n\n&lt;p&gt;By uploading your Contributions to the Website, you hereby authorize Company to grant to each end user a personal, limited, non-transferable, perpetual, non-exclusive, royalty-free, fully-paid license to access, download, print and otherwise use your Contributions for their internal purposes and not for distribution, transfer, sale or commercial exploitation of any kind.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;SUBMISSIONS&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;You acknowledge and agree that any questions, comments, suggestions, ideas, feedback or other information about the Website or the Company Services (&quot;Submissions&quot;) provided by you to Company are non-confidential and Company (as well as any designee of Company) shall be entitled to the unrestricted use and dissemination of these Submissions for any purpose, commercial or otherwise, without acknowledgment or compensation to you.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;PROHIBITED ACTIVITIES&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;You may not access or use the Website for any other purpose other than that for which Company makes it available. The Website may not be used in connection with any commercial endeavors except those that are specifically endorsed or approved by Company. Prohibited activity includes, but is not limited to:&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1. &lt;/strong&gt;attempting to bypass any measures of the Website designed to prevent or restrict access to the Website, or any portion of the Website&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;attempting to impersonate another user or person or using the username of another user&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;criminal or tortious activity&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;deciphering, decompiling, disassembling or reverse engineering any of the software comprising or in any way making up a part of the Website&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;deleting the copyright or other proprietary rights notice from any Website content&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;6.&lt;/strong&gt;engaging in any automated use of the system, such as using any data mining, robots or similar data gathering and extraction tools&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;7.&lt;/strong&gt;except as may be the result of standard search engine or Internet browser usage, using or launching, developing or distributing any automated system, including, without limitation, any spider, robot (or &quot;bot&quot;), cheat     utility, scraper or offline reader that accesses the Website, or using or launching any unauthorized script or other software&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;8.&lt;/strong&gt;harassing, annoying, intimidating or threatening any Company employees or agents engaged in providing any portion of the Company Services to you&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;9.&lt;/strong&gt;interfering with, disrupting, or creating an undue burden on the Website or the networks or services connected to the Website&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;10.&lt;/strong&gt;making any unauthorized use of the Company Services, including collecting usernames and/or email addresses of users by electronic or other means for the purpose of sending unsolicited email, or creating user accounts by automated means or under false pretenses&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;11.&lt;/strong&gt;selling or otherwise transferring your profile&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;12.&lt;/strong&gt;tricking, defrauding or misleading Company and other users, especially in any attempt to learn sensitive account information such as passwords&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;13.&lt;/strong&gt;using any information obtained from the Website in order to harass, abuse, or harm another person&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;14.&lt;/strong&gt;using the Company Services as part of any effort to compete with Company or to provide services as a service bureau&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;15.&lt;/strong&gt;using the Website in a manner inconsistent with any and all applicable laws and regulations&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;INTELLECTUAL PROPERTY RIGHTS&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;The content on the Website (“Company Content”) and the trademarks, service marks and logos contained therein (“Marks”) are owned by or licensed to Company, and are subject to copyright and other  intellectual property rights under United States and foreign laws and international conventions. Company Content, includes, without limitation, all source code, databases, functionality, software, website designs, audio, video, text, photographs and graphics. All Company graphics, logos, designs, page headers, button icons, scripts and service names are registered trademarks, common law trademarks or trade dress of Company in the United States and/or other countries. Company&amp;#39;s trademarks and trade dress may not be used, including as part of trademarks and/or as part of domain names, in connection with any product or service in any manner that is likely to cause confusion and may not be copied, imitated, or used, in whole or in part, without the prior written permission of the Company.&lt;/p&gt;\n\n&lt;p&gt;Company Content on the Website is provided to you “AS IS” for your information and personal use only and may not be used, copied, reproduced, aggregated, distributed, transmitted, broadcast, displayed, sold, licensed, or otherwise exploited for any other purposes whatsoever without the prior written consent of the respective owners. Provided that you are eligible to use the Website, you are granted a limited license to access and use the Website and the Company Content and to download or print a copy of any portion of the Company Content to which you have properly gained access solely for your personal, non- commercial use. Company reserves all rights not expressly granted to you in and to the Website and Company Content and Marks.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;THIRD PARTY WEBSITES AND CONTENT&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;The Website contains (or you may be sent through the Website or the Company Services) links to other websites (&quot;Third Party Websites&quot;) as well as articles, photographs, text, graphics, pictures, designs, music, sound, video, information, applications, software and other content or items belonging to or originating from third parties (the &quot;Third Party Content&quot;). Such Third Party Websites and Third Party Content are not investigated, monitored or checked for accuracy, appropriateness, or completeness by us, and we are not responsible for any Third Party Websites accessed through the Website or any Third Party Content posted on, available through or installed from the Website, including the content, accuracy, offensiveness, opinions, reliability, privacy practices or other policies of or contained in the Third Party Websites or the Third Party Content. Inclusion of, linking to or permitting the use or installation of any Third Party Website or any Third Party Content does not imply approval or endorsement thereof by us. If you decide to leave the Website and access the Third Party Websites or to use or install any Third Party Content, you do so at your own risk and you should be aware that our terms and policies no longer govern. You should review the applicable terms and policies, including privacy and data gathering practices, of any website to which you navigate from the Website or relating to any applications you use or install from the Website. Any purchases you make through Third Party Websites will be through other websites and from other companies, and Company takes no responsibility whatsoever in relation to such purchases which are exclusively between you and the applicable third party.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;SITE MANAGEMENT&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Company reserves the right but does not have the&lt;/p&gt;\n\n&lt;p&gt;obligation to: A.? monitor the Website for violations of this Agreement;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1.&lt;/strong&gt;take appropriate legal action against anyone who, in Company’s sole discretion, violates this&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;Agreement, including without limitation, reporting such user to law enforcement authorities;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;in Company’s sole discretion and without limitation, refuse, restrict access to or availability of, or disable (to the extent technologically feasible) any user’s contribution or any portion thereof that may violate this Agreement or any Company policy;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;in Company’s sole discretion and without limitation, notice or liability to remove from the Website or otherwise disable all files and content that are excessive in size or are in any way burdensome to Company’s systems;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;otherwise manage the Website in a manner designed to protect the rights and property of Company and others and to facilitate the proper functioning of the Website.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;PRIVACY POLICY&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;We care about the privacy of our users. Please review the Company Privacy Policy. By using the Website or Company Services, you are consenting to have your personal data transferred to and processed in the United States. By using the Website or the Company Services, you are consenting to the terms of our Privacy Policy.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;DIGITAL MILLENNIUM COPYRIGHT ACT (DMCA) NOTICE AND POLICY&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Notifications&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;If you believe that content available on or through our Website infringes one or more of your copyrights, please immediately notify our Designated Copyright Agent by mail, email or faxed notice (“Notification”) providing the information described below, which Notification is pursuant to DMCA 17 U.S.C. § 512(c)(3). A copy of your Notification will be sent to the person who posted or stored the material addressed in the Notification. Please be advised that pursuant to federal law you may be held liable for damages if you make material misrepresentations in a Notification. Thus, if you are not sure that content located on or linked to by our Website infringes your copyright, you should consider first contacting an attorney. Our Website has a policy of terminating repeat infringers in appropriate circumstances.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;All Notifications should include the following:&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1.&lt;/strong&gt;A physical or electronic signature of a person authorized to act on behalf of the owner of an exclusive right that is allegedly infringed.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;Identification of the copyrighted work claimed to have been infringed, or, if multiple copyrighted works at a single online website are covered by a single notification, a representative list of such works at that website.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;Identification of the material that is claimed to be infringing or to be the subject of infringing activity and that is to be removed or access to which is to be disabled, and information reasonably sufficient to permit us to locate the material.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;Information reasonably sufficient to permit us to contact the complaining party, such as an address, telephone number, and, if available, an electronic mail address at which the complaining party may be contacted.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;A statement that the complaining party has a good faith belief that use of the material in the manner complained of is not authorized by the copyright owner, its agent, or the law.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;6.&lt;/strong&gt;A statement that the information in the notification is accurate, and under penalty of perjury, that the complaining party is authorized to act on behalf of the owner of an exclusive right that is allegedly infringed.&lt;/p&gt;\n\n&lt;p&gt;Notifications should be sent to our Designated Copyright Agent as follows:&lt;/p&gt;\n\n&lt;p&gt;Designated Copyright Agent&lt;br&gt;\nBeth Sumners, Firequick Products, Inc. (“Company”) PO Box 910&lt;br&gt;\nInyokern, CA 93527&lt;br&gt;\nEmail:&lt;strong&gt; bsumners@firequick.com &lt;/strong&gt;Phone: &lt;strong&gt;(855) 974-3473&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;We also will advise the alleged infringer of the DMCA statutory Counter Notification procedure described below by which the alleged infringer may respond to your claim and request that we restore this material.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Counter Notification&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;If you believe your own copyrighted material has been removed from our Website and/or our service as a result of mistake or misidentification, you may submit a written counter notification (“Counter Notification”) to our Designated Copyright Agent pursuant to DMCA 17 U.S.C. § 512(g)(2) and (3). To be an effective Counter Notification under the DMCA, your Counter Notification must include substantially the following:&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1.&lt;/strong&gt;Identification of the material that has been removed or disabled and the location at which the material appeared before it was removed or disabled.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;A statement that you consent to the jurisdiction of the Federal District Court in which your address is located, or if your address is outside the United States, for any judicial district in which our Company is located.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;A statement that you will accept service of process from the party that filed the Notification or the party&amp;#39;s agent.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;Your name, address and telephone number.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;A statement under penalty of perjury that you have a good faith belief that the material in question was removed or disabled as a result of mistake or misidentification of the material to be removed or disabled.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;6.&lt;/strong&gt;Your physical or electronic signature.&lt;/p&gt;\n\n&lt;p&gt;You may submit your Counter Notification to our Designated Copyright Agent by fax, mail, or email as set forth above.&lt;/p&gt;\n\n&lt;p&gt;If you send us a valid, written Counter Notification meeting the requirements described above, we will restore your removed or disabled material after ten (10) business days but no later than fourteen (14) business days from the date we receive your Counter Notification, unless our Designated Copyright  Agent first receives notice from the party filing the original Notification informing us that such party has filed a court action to restrain you from engaging in infringing activity related to the material in question. Please note that if you materially misrepresent that the disabled or removed content was removed by mistake or misidentification, you may be liable for damages, including costs and attorney&amp;#39;s fees. Filing a false Counter Notification constitutes perjury.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;TERM AND TERMINATION&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;This Agreement shall remain in full force and effect while you use the Website or are otherwise a user or member of the Website, as applicable. You may terminate your use or participation at any time, for any reason, by following the instructions for terminating user accounts in your account settings, if available, or by contacting us using the contact information below.&lt;/p&gt;\n\n&lt;p&gt;WITHOUT LIMITING ANY OTHER PROVISION OF THIS AGREEMENT, COMPANY RESERVES THE RIGHT TO, IN COMPANY’S SOLE DISCRETION AND WITHOUT NOTICE OR LIABILITY, DENY ACCESS TO AND USE OF THE WEBSITE AND THE COMPANY SERVICES, TO ANY PERSON FOR ANY REASON OR FOR NO REASON AT ALL, INCLUDING WITHOUT LIMITATION FOR BREACH OF ANY REPRESENTATION, WARRANTY OR COVENANT CONTAINED IN THIS AGREEMENT, OR OF ANY APPLICABLE LAW OR REGULATION, AND COMPANY MAY TERMINATE YOUR USE OR PARTICIPATION IN THE WEBSITE AND THE COMPANY SERVICES, DELETE YOUR PROFILE AND ANY CONTENT OR INFORMATION THAT YOU HAVE POSTED AT ANY TIME, WITHOUT WARNING, IN COMPANY’S SOLE DISCRETION.&lt;/p&gt;\n\n&lt;p&gt;In order to protect the integrity of the Website and Company Services, Company reserves the right at any time in its sole discretion to block certain IP addresses from accessing the Website and Company Services.&lt;/p&gt;\n\n&lt;p&gt;&lt;br&gt;\nAny provisions of this Agreement that, in order to fulfill the purposes of such provisions, need to survive the termination or expiration of this Agreement, shall be deemed to survive for as long as necessary to fulfill such purposes.&lt;/p&gt;\n\n&lt;p&gt;YOU UNDERSTAND THAT CERTAIN STATES ALLOW YOU TO CANCEL THIS AGREEMENT, WITHOUT ANY PENALTY OR OBLIGATION, AT ANY TIME PRIOR TO MIDNIGHT OF COMPANY’S THIRD BUSINESS DAY FOLLOWING THE DATE OF THIS AGREEMENT, EXCLUDING SUNDAYS AND HOLIDAYS. TO CANCEL, CALL A COMPANY CUSTOMER CARE REPRESENTATIVE DURING NORMAL BUSINESS HOURS USING THE CONTACT INFORMATION LISTING BELOW IN THIS AGREEMENT OR BY ACCESSING YOUR ACCOUNT SETTINGS. THIS SECTION APPLIES ONLY TO INDIVIDUALS RESIDING IN STATES WITH SUCH LAWS.&lt;/p&gt;\n\n&lt;p&gt;If Company terminates or suspends your account for any reason, you are prohibited from registering and creating a new account under your name, a fake or borrowed name, or the name of any third party, even if you may be acting on behalf of the third party. In addition to terminating or suspending your account, Company reserves the right to take appropriate legal action, including without limitation pursuing civil, criminal, and injunctive redress.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;MODIFICATIONS&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;To Agreement&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;Company may modify this Agreement from time to time. Any and all changes to this Agreement will be posted on the Website and revisions will be indicated by date. You agree to be bound to any changes to this Agreement when you use the Company Services after any such modification becomes effective. Company may also, in its discretion, choose to alert all users with whom it maintains email information of such modifications by means of an email to their most recently provided email address. It is therefore important that you regularly review this Agreement and keep your contact information current in your account settings to ensure you are informed of changes. You agree that you will periodically check the Website for updates to this Agreement and you will read the messages we send you to inform you of any changes. Modifications to this Agreement shall be effective after posting.&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;To Services&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;Company reserves the right at any time to modify or discontinue, temporarily or permanently, the Company Services (or any part thereof) with or without notice. You agree that Company shall not be  liable to you or to any third party for any modification, suspension or discontinuance of the Company Services.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;DISPUTES&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Between Users&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;If there is a dispute between users of the Website, or between users and any third party, you understand and agree that Company is under no obligation to become involved. In the event that you have a dispute with one or more other users, you hereby release Company, its officers, employees, agents and successors in rights from claims, demands and damages (actual and consequential) of every kind or&lt;/p&gt;\n\n&lt;p&gt;nature, known or unknown, suspected and unsuspected, disclosed and undisclosed, arising out of or in any way related to such disputes and/or the Company Services.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;With Company&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1.&lt;/strong&gt;Governing Law; Jurisdiction. This Agreement and all aspects of the Website and Company Services shall be governed by and construed in accordance with the internal laws of the State/Commonwealth of California, without regard to conflict of law provisions. With respect to any disputes or claims not subject to informal dispute resolution or arbitration (as set forth below), you agree not to commence or prosecute any action in connection therewith other than in the state and federal courts located in Kern County, State of California, and you hereby consent to, and waive all defenses of lack of personal jurisdiction and forum non conveniens with respect to, venue and jurisdiction in such state and federal courts. Application of the United Nations Convention on Contracts for the International Sale of Goods is excluded from this Agreement. Additionally, application of the Uniform Computer Information Transaction Act (UCITA) is excluded from this Agreement. In no event shall any claim, action or proceeding by you related in any way to the Website or Company Services be instituted more than two (2) years after the cause of action arose.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;Informal Resolution. To expedite resolution and control the cost of any dispute, controversy or claim related to this Agreement (&quot;Dispute&quot;), you and Company agree to first attempt to negotiate any Dispute (except those Disputes expressly provided below) informally for at least thirty (30) days before initiating any arbitration or court proceeding. Such informal negotiations commence upon written notice from one person to the other.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;Binding Arbitration. If you and Company are unable to resolve a Dispute through informal negotiations, either you or Company may elect to have the Dispute (except those Disputes expressly excluded below) finally and exclusively resolved by binding arbitration. Any election to arbitrate by one party shall be final and binding on the other. YOU UNDERSTAND THAT ABSENT THIS PROVISION, YOU WOULD HAVE THE RIGHT TO SUE IN COURT AND HAVE A JURY TRIAL. The arbitration shall be commenced and conducted under the Commercial Arbitration Rules of the American Arbitration Association (&quot;AAA&quot;) and, where appropriate, the AAA’s Supplementary Procedures for Consumer Related Disputes (&quot;AAA Consumer Rules&quot;), both of which are available at the AAA website www.adr.org. The determination of whether a Dispute is subject to arbitration shall be governed by the Federal Arbitration Act and determined by a court rather than an arbitrator. Your arbitration fees and your share of arbitrator compensation shall be governed by the AAA Consumer Rules and, where appropriate, limited by the AAA Consumer Rules. If such costs are determined by the arbitrator to be excessive, Company will pay all arbitration fees and expenses. The arbitration may be conducted in person, through the submission of documents, by phone or online. The arbitrator will make a decision in writing, but need not provide a statement of reasons unless requested by a party. The arbitrator must follow applicable law, and any award may be challenged if the arbitrator fails to do so. Except where otherwise required by the applicable AAA rules or applicable law, the arbitration will take place in Kern County, State of California. Except as otherwise provided in this Agreement, you and Company may litigate in court to compel arbitration, stay proceedings pending arbitration, or to confirm, modify, vacate or enter judgment on the award entered by the arbitrator.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;Restrictions. You and Company agree that any arbitration shall be limited to the Dispute between Company and you individually. To the full extent permitted by law, (1) no arbitration shall be joined with any other; (2) there is no right or authority for any Dispute to be arbitrated on a class-action basis or to utilize class action procedures; and (3) there is no right or authority for any Dispute to be brought in a purported representative capacity on behalf of the general public or any other persons.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;Exceptions to Informal Negotiations and Arbitration. You and Company agree that the following Disputes are not subject to the above provisions concerning informal negotiations and binding arbitration: (1) any Disputes seeking to enforce or protect, or concerning the validity of any of your or Company’s intellectual property rights; (2) any Dispute related to, or arising from, allegations of theft, piracy, invasion of privacy or unauthorized use; and (3) any claim for injunctive relief. If this Section is found to be illegal or unenforceable then neither you nor Company will elect to arbitrate any Dispute falling within that portion of this Section found to be illegal or unenforceable and such Dispute shall be decided by a court of competent jurisdiction within the courts listed for jurisdiction above, and you and Company agree to submit to the personal jurisdiction of that court.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;CORRECTIONS&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Occasionally there may be information on the Website that contains typographical errors, inaccuracies or omissions that may relate to service descriptions, pricing, availability, and various other information. Company reserves the right to correct any errors, inaccuracies or omissions and to change or update the information at any time, without prior notice.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;DISCLAIMERS&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Company cannot control the nature of all of the content available on the Website. By operating the Website, Company does not represent or imply that Company endorses any blogs, contributions or other content available on or linked to by the Website, including without limitation content hosted on third party websites or provided by third party applications, or that Company believes contributions, blogs or other content to be accurate, useful or non-harmful. We do not control and are not responsible for unlawful or otherwise objectionable content you may encounter on the Website or in connection with any contributions. The Company is not responsible for the conduct, whether online or offline, of any user of the Website or Company Services.&lt;/p&gt;\n\n&lt;p&gt;YOU AGREE THAT YOUR USE OF THE WEBSITE AND COMPANY SERVICES WILL BE AT YOUR SOLE RISK. TO THE FULLEST EXTENT PERMITTED BY LAW, COMPANY, ITS OFFICERS, DIRECTORS, EMPLOYEES, AND AGENTS DISCLAIM ALL WARRANTIES, EXPRESS OR IMPLIED, IN CONNECTION WITH THE WEBSITE AND THE COMPANY SERVICES AND YOUR USE THEREOF, INCLUDING, WITHOUT LIMITATION, THE IMPLIED WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND NON-INFRINGEMENT. COMPANY MAKES NO WARRANTIES OR REPRESENTATIONS ABOUT THE ACCURACY OR COMPLETENESS OF THE WEBSITE’S CONTENT OR THE CONTENT OF ANY WEBSITES LINKED TO THIS WEBSITE AND ASSUMES NO LIABILITY OR RESPONSIBILITY FOR ANY (A) ERRORS, MISTAKES, OR INACCURACIES OF CONTENT AND MATERIALS, (B) PERSONAL INJURY OR PROPERTY DAMAGE, OF ANY NATURE WHATSOEVER, RESULTING FROM YOUR ACCESS TO AND USE OF OUR WEBSITE, (C) ANY UNAUTHORIZED ACCESS TO OR USE OF OUR SECURE SERVERS AND/OR ANY AND ALL PERSONAL INFORMATION AND/OR FINANCIAL INFORMATION STORED THEREIN, (D) ANY&lt;/p&gt;\n\n&lt;p&gt;INTERRUPTION OR CESSATION OF TRANSMISSION TO OR FROM THE WEBSITE OR COMPANY SERVICES, (E) ANY BUGS, VIRUSES, TROJAN HORSES, OR THE LIKE WHICH MAY BE TRANSMITTED TO OR THROUGH THE WEBSITE BY ANY THIRD PARTY, AND/OR (F) ANY ERRORS OR OMISSIONS IN ANY CONTENT AND MATERIALS OR FOR ANY LOSS OR DAMAGE OF ANY KIND INCURRED AS A RESULT OF THE USE OF ANY CONTENT POSTED, TRANSMITTED, OR OTHERWISE MADE AVAILABLE VIA THE WEBSITE. COMPANY DOES NOT WARRANT, ENDORSE, GUARANTEE, OR ASSUME RESPONSIBILITY FOR ANY PRODUCT OR SERVICE ADVERTISED OR OFFERED BY A THIRD PARTY THROUGH THE WEBSITE OR ANY HYPERLINKED WEBSITE OR FEATURED IN ANY BANNER OR OTHER ADVERTISING, AND COMPANY WILL NOT BE A PARTY TO OR IN ANY WAY BE RESPONSIBLE FOR MONITORING ANY TRANSACTION BETWEEN YOU AND THIRD-PARTY PROVIDERS OF PRODUCTS OR SERVICES. AS WITH THE PURCHASE OF A PRODUCT OR SERVICE THROUGH ANY MEDIUM OR IN ANY ENVIRONMENT, YOU SHOULD USE YOUR BEST JUDGMENT AND EXERCISE CAUTION WHERE APPROPRIATE.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;LIMITATIONS OF LIABILITY&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;IN NO EVENT SHALL COMPANY OR ITS DIRECTORS, EMPLOYEES, OR AGENTS BE LIABLE TO YOU OR ANY THIRD PARTY FOR ANY DIRECT, INDIRECT, CONSEQUENTIAL, EXEMPLARY, INCIDENTAL, SPECIAL OR PUNITIVE DAMAGES, INCLUDING LOST PROFIT, LOST REVENUE, LOSS OF DATA OR OTHER DAMAGES ARISING FROM YOUR USE OF THE WEBSITE OR COMPANY SERVICES, EVEN IF COMPANY HAS BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES. NOTWITHSTANDING ANYTHING TO THE CONTRARY CONTAINED HEREIN, COMPANY’S LIABILITY TO YOU FOR ANY CAUSE WHATSOEVER AND REGARDLESS OF THE FORM OF THE ACTION, WILL AT ALL TIMES BE LIMITED TO THE AMOUNT PAID, IF ANY, BY YOU TO COMPANY FOR THE COMPANY SERVICES DURING THE PERIOD OF THREE (3) MONTHS PRIOR TO ANY CAUSE OF ACTION ARISING.&lt;/p&gt;\n\n&lt;p&gt;CERTAIN STATE LAWS DO NOT ALLOW LIMITATIONS ON IMPLIED WARRANTIES OR THE EXCLUSION OR LIMITATION OF CERTAIN DAMAGES. IF THESE LAWS APPLY TO YOU, SOME OR ALL OF THE ABOVE DISCLAIMERS OR LIMITATIONS MAY NOT APPLY TO YOU, AND YOU MAY HAVE ADDITIONAL RIGHTS.&lt;/p&gt;\n\n&lt;p&gt;IF YOU ARE A CALIFORNIA RESIDENT, YOU WAIVE CALIFORNIA CIVIL CODE SECTION 1542, WHICH SAYS: &quot;A GENERAL RELEASE DOES NOT EXTEND TO CLAIMS WHICH THE CREDITOR DOES NOT KNOW OR SUSPECT TO EXIST IN HIS FAVOR AT THE TIME OF EXECUTING THE RELEASE, WHICH, IF KNOWN BY HIM MUST HAVE MATERIALLY AFFECTED HIS SETTLEMENT WITH THE DEBTOR.&quot;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;INDEMNITY&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;You agree to defend, indemnify and hold Company, its subsidiaries, and affiliates, and their respective officers, agents, partners and employees, harmless from and against, any loss, damage, liability, claim, or demand, including reasonable attorneys’ fees and expenses, made by any third party due to or arising out of your contributed content, use of the Company Services, and/or arising from a breach of this Agreement and/or any breach of your representations and warranties set forth above. Notwithstanding the foregoing, Company reserves the right, at your expense, to assume the exclusive defense and control of any matter for which you are required to indemnify Company, and you agree to cooperate, at your expense, with&lt;/p&gt;\n\n&lt;p&gt;Company’s defense of such claims. Company will use reasonable efforts to notify you of any such claim, action, or proceeding which is subject to this indemnification upon becoming aware of it.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;NOTICES&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Except as explicitly stated otherwise, any notices given to Company shall be given by email to the address listed in the contact information below. Any notices given to you shall be given to the email address you provided during the registration process, or such other address as each party may specify. Notice shall be deemed to be given twenty-four (24) hours after the email is sent, unless the sending party is notified that the email address is invalid. We may also choose to send notices by regular mail.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;USER DATA&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Our Website will maintain certain data that you transfer to the Website for the purpose of the performance of the Company Services, as well as data relating to your use of the Company Services. Although we perform regular routine backups of data, you are primarily responsible for all data that you have transferred or that relates to any activity you have undertaken using the Company Services. You agree that Company shall have no liability to you for any loss or corruption of any such data, and you hereby waive any right of action against Company arising from any such loss or corruption of such data.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;ELECTRONIC CONTRACTING&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Your use of the Company Services includes the ability to enter into agreements and/or to make transactions electronically. YOU ACKNOWLEDGE THAT YOUR ELECTRONIC SUBMISSIONS CONSTITUTE YOUR AGREEMENT AND INTENT TO BE BOUND BY AND TO PAY FOR SUCH AGREEMENTS AND TRANSACTIONS. YOUR AGREEMENT AND INTENT TO BE BOUND BY ELECTRONIC SUBMISSIONS APPLIES TO ALL RECORDS RELATING TO ALL TRANSACTIONS YOU ENTER INTO RELATING TO THE COMPANY SERVICES, INCLUDING NOTICES OF CANCELLATION,&lt;br&gt;\nPOLICIES, CONTRACTS, AND APPLICATIONS. In order to access and retain your electronic records, you may be required to have certain hardware and software, which are your sole responsibility.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;ELECTRONIC SIGNATURES&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Users are allowed on &lt;a href=&quot;http://www.firequick.com&quot;&gt;www.firequick.com&lt;/a&gt; to transmit and receive valid electronic signatures in the United States under the Electronic Signatures in Global and National Commerce Act (E-Sign Act) of 2000 and the Uniform Electronic Transactions Act (UETA) of 1999 as adopted by individual states. Users’ signatures and identities are not authenticated on &lt;a href=&quot;https://www.firequick.com&quot;&gt;www.firequick.com&lt;/a&gt;.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;MISCELLANEOUS&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;This Agreement constitutes the entire agreement between you and Company regarding the use of the Company Services. The failure of Company to exercise or enforce any right or provision of this Agreement shall not operate as a waiver of such right or provision. The section titles in this Agreement are for convenience only and have no legal or contractual effect. This Agreement operates to the fullest extent permissible by law. This Agreement and your account may not be assigned by you without our express written consent. Company may assign any or all of its rights and obligations to others at any time. Company shall not be responsible or liable for any loss, damage, delay or failure to act caused by any cause beyond Company&amp;#39;s reasonable control. If any provision or part of a provision of this Agreement is&lt;/p&gt;\n\n&lt;p&gt;unlawful, void or unenforceable, that provision or part of the provision is deemed severable from this Agreement and does not affect the validity and enforceability of any remaining provisions. There is no joint venture, partnership, employment or agency relationship created between you and Company as a result of this Agreement or use of the Website and Company Services. Upon Company’s request, you will furnish Company any documentation, substantiation or releases necessary to verify your compliance with this Agreement. You agree that this Agreement will not be construed against Company by virtue of having drafted them. You hereby waive any and all defenses you may have based on the electronic form of this Agreement and the lack of signing by the parties hereto to execute this Agreement.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;CONTACT US&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;In order to resolve a complaint regarding the Company Services or to receive further information regarding use of the Company Services, please contact Company as set forth below or, if any complaint with us is not satisfactorily resolved, and you are a California resident, you can contact the Complaint Assistance Unit of the Division of Consumer Services of the Department of Consumer Affairs in writing at 400 &quot;R&quot; Street, Sacramento, California 95814 or by telephone at 1-916-445-1254.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Firequick Products, Inc.&lt;br&gt;\nPO Box 910&lt;br&gt;\nInyokern, CA 93527&lt;br&gt;\nEmail: admin@firequick.com Phone: (855) 374-3473&lt;br&gt;\nFax: (760) 377-5761&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;GENERAL INSTRUCTIONS&lt;br&gt;\nWHAT IS A TERMS OF USE AGREEMENT?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;A Terms of Use Agreement is a written set of rules and regulations between two parties, the User and the Company, that the User must agree to follow in order to use the Company’s website and services.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;WHEN   IS   A   TERMS    OF    USE AGREEMENT NEEDED?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;While Terms and Conditions are not required by law, any website, especially e-commerce or social networking websites or applications and any website or internet service provider that stores a User’s personal data, should consider having Terms and Conditions.&lt;/p&gt;\n\n&lt;p&gt;A written set of Terms and Conditions protects the Company and acts an instruction manual for its website. It allows the Company to explain things related to its service or product, including, among other things:&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1.&lt;/strong&gt;how purchases, payment, and returns are handled&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;ownership and use of content and intellectual property&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;how Users must conduct themselves, including any prohibited behavior&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;limitations on liability and disclaimers&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;the Company’s privacy policy&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;WHO    NEEDS    A    TERMS    OF    USE AGREEMENT?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Almost every website or application that  provides a service or product has a Terms of Use Agreement.&lt;/p&gt;\n\n&lt;p&gt;Here are some examples of websites and apps that use a Terms of Use Agreement:&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1.&lt;/strong&gt;E-Commerce Company - Ebay, Amazon, Target, Gap&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;Social Media Website or Application - Facebook, Instagram, Twitter, Snapchat&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;Search Engine - Google, Yahoo, Bing&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;Website or Application Providing a Service or Product - YouTube, Apple, Uber&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;Gaming Website or Application - Playstation, Pokemon Go, Candy Crush&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;WHAT SHOULD BE INCLUDED IN A TEMS OF USE?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;A simple Terms of Service should generally  have at least the following:&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1.&lt;/strong&gt;Who is the Company providing the service or product&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;What is the service or product provided by the Company&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;Where is the Company’s website&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;When will the agreement terminate&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;Why might the User not be granted access to the website&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;6.&lt;/strong&gt;How does the User agree to accept the Terms of Service&lt;/p&gt;\n\n&lt;p&gt;The Company can tailor the rules and regulations, or “terms of use”, according to the service or product it provides and its specific needs. The Terms of Use Agreement can be posted on the Company’s website either as a browsewrap agreement or a clickwrap agreement.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;OTHER NAMES&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;As a reference, a Terms of Use Agreement is known by other names:&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;1.&lt;/strong&gt;Terms of Service Agreement&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2.&lt;/strong&gt;Terms and Conditions&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&lt;/strong&gt;User Agreement&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4.&lt;/strong&gt;Statement of Rights and Responsibilities&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;5.&lt;/strong&gt;Disclaimer&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;6.&lt;/strong&gt;TOU&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;7.&lt;/strong&gt;ToS&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;8.&lt;/strong&gt;TOS&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;9.&lt;/strong&gt;TOC&lt;/p&gt;\n', '1', '2');
INSERT INTO `posts` (`post_id`, `title`, `content`, `type`, `status`) VALUES
(35, 'FAQ', '&lt;div&gt;\n&lt;div&gt;\n&lt;div&gt;\n&lt;div&gt;\n&lt;div&gt;\n&lt;p&gt;&lt;strong&gt;Who can buy flares and launchers from Firequick Products?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;You must be a professionally trained fire fighter, currently employed by a firefighting /land management agency in order to purchase the flares or launchers, which are considered restricted items. A buyer for restricted items must be qualified in our customer base before they can place their first order. Once qualified, you will be able to place future orders easily. Anyone can buy the Wiley-X or other accessory items.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;How do I become a qualified buyer?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Call the Firequick office at 1-760-377-5766 or 1-855-FPI-FIRE. We need your name, phone number, email, current agency name, billing and shipping addresses. We do an internet check and if we can link you adequately to your current information, we can qualify you. If we are unable to meet the qualification criteria, we will require documentation of your training / certification (red card or similar) and may also need verification of your employment on the letterhead of your current agency.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Where can I get pricing information?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;You can find the information on this website home page, under “About” and then “Documents”.  Likewise, you can call our office for a formal quote or to have a price list emailed to you. Keep in mind if you are ordering in bulk (10 or more launchers or cases of flares) you may qualify for a quantity discount. To obtain an accurate quote for bulk purchases, you must call the office.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Does Firequick have a Distributor?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Firequick does not use a Distributor. We manufacture and sell our products directly which helps keep the cost lower for our customers. We have a &lt;a href=&quot;https://www.firequick.com/documents/flares/FQ_Sole_Source.pdf&quot;&gt;Sole Source letter&lt;/a&gt; available for download if you need it to support your purchased.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;How quickly will I receive my order?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Usually, we maintain a good amount of stock during all times of the year and if placed by noon PST, your order will go out the same day.  If we are unable to ship the same day, we will give you a delivery estimate at the time of your request.  Keep in mind that Firequick flares and cartridges must ship as Dangerous Goods under CFR 49 and so deliveries requiring air shipment will be considerably more expensive than shipping via ground.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Can Firequick support me at my fire camp / incident management location?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;In most cases, particularly on the west coast, Firequick will make emergency deliveries to your fire camp if requested. We charge a delivery fee based on the time and travel requirements unique to each situation.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;I am having performance problems with my launcher, what should I do?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;The best course, is to call our office and describe the problem so that we can best guide you. Most launcher glitches can be fixed quite easily.  If your launcher needs sent in for repair, please download the &lt;a href=&quot;https://www.firequick.com/wp-content/uploads/2017/06/Launcher-Repair-Request-2009-rev_-06-02-17.pdf&quot;&gt;Launcher Repair Request form&lt;/a&gt; from this website and follow the instructions for sending your launcher in. If you are experiencing a problem with cartridge casings sticking in the cylinder after firing, please review the next two questions also.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Why are the cartridge casings so difficult to extract from my cylinder after firing?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;If you are having occasional sticking problems, try first to remedy the issue by cleaning the bore holes on your cylinder; this can alleviate minor sticking. If you are having serious problems, particularly with the launcher II (orange handled pistol-style), we probably need to replace your cylinder with one that has been modified since your purchase. Some years back, the manufacturer of the cartridges release a large number of cases that contained over-pressured cartridges. These cartridges appear the same as they have for over 20 years so are difficult to distinguish by sight. When fired, they over expand and make it nearly impossible to eject the casings without damaging the cylinder pin. To remedy this, we had modified cylinders manufactured to correct the ejection issue, and as of June 2017, we issued a recall on the Launcher III cylinders to be replaced with no repair charge to the customer.  If you haven’t already, please send your launcher in to get a new cylinder!  To return your launcher, please download the &lt;a href=&quot;https://www.firequick.com/wp-content/uploads/2017/06/Launcher-Repair-Request-2009-rev_-06-02-17.pdf&quot;&gt;Launcher Repair Request form&lt;/a&gt; from this website and follow the instructions.  Once sent in, we make every effort to get your launcher’s cylinder switched out, tested and returned within a few days&lt;/p&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n\n&lt;div&gt;\n&lt;div&gt;\n&lt;div&gt;\n&lt;div&gt;\n&lt;div&gt;\n&lt;p&gt;&lt;strong&gt;I still have problems getting cartridges to eject easily from the cylinder in my Launcher III.  What can I do?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;If you are still experiencing cartridge ejection problems after you have had a modified cylinder installed by Firequick, it could be that you are operating in cold temperatures (below 55° F) and/or you are not using #6 Powers Fasteners.  We only recommend #6 Powers and the last remaining #6 Winchester cartridges, during normal use.  During cold weather, we recommend that you use the red #5 cartridges.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Can I use off-the-shelf cartridges in my launcher?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Most cartridges you can purchase off-the-shelf are not appropriate for a Firequick launcher. Those readily available in hardware stores are not of high-enough fire-power to either launcher or project the flares from the launcher. For a brief period, Firequick sold #6 Bluepoint cartridges. Please DO NOT use these cartridges!  If you have Bluepoint cartridges that you purchased from Firequick in the past, we will replace the remainder at no cost.  Call us with your invoice information and the amount that you have left.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Is it legal for me to ship a FQ Launcher?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Yes.  According to ATF, our launchers are designated as “non-firearms” therefore, you do not need a special license/certification to initiate a shipment of the launcher back to us for repairs. You can pack and send your launcher via USPS or common carrier.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Is it legal for me to ship FQ flares or cartridges back to Firequick or to another user?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Unless you are certified to ship hazardous materials and/or dangerous goods, the answer is “no”!  Flares and cartridges must be packaged/marked according to CFR 49 guidelines if shipped ground, and IATA guidelines, if shipped by air. If you are not a certified shipper, you can not legally sign the documents or offer dangerous goods for transportation by a carrier. Further, the carrier used must be certified.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Can you ship my order to my home address?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;If your order contains restricted items (Flares, cartridges and launchers) we cannot send it to a residential address. Further, if you have changed your ship-to address after being qualified in our data base, we will need to re-qualify your customer information. This can be done quickly and easily and is to prevent the restricted goods from potentially getting into the wrong hands.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Does Firequick offer any training for their products?&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Yes, we have a User Training Workbook available by hard copy, or digital download (go to the Accessories page). In addition, we are happy to assist on-site with your ignition devices training when requested. As non-firefighters, we do not attempt to train on burn operations, but do provide solid product safe use and handling training, including transportation, storage, destruction, etc. When appropriate, we bring demonstration devices, new products, etc. to the trainings to give your students hands-on experience with the line. Financial support for training requests is negotiable on a case-by-case basis. Please call the office if you would like to discuss the potential of support for your training class.&lt;/p&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n\n&lt;p&gt; &lt;/p&gt;\n', '1', '1'),
(36, 'Company History', '&lt;div&gt;\n&lt;div&gt;\n&lt;div&gt;\n&lt;p&gt;At Firequick Products, we fight fire with fire! We manufacture incendiary flares and launcher systems for wildland fire fighters who want safe, effective, and reliable means of initiating fire for both control and prescribed burn operations. Our patented designs have positioned us a as sole source provider of these highly effective fire management tools.&lt;/p&gt;\n\n&lt;p&gt;Unlike other ignition devices in the industry, our remote ignition equipped products have a guaranteed 95% ignition rate, burn at an unprecedented 4000° F, and significantly improve the efficiency and safety of the user.&lt;/p&gt;\n\n&lt;p&gt;We strive to design our fire-fighting tools specifically to meet the unique product needs of our customer. We work in concert with many of the nation’s Hot Shot crews, USFS leaders and others to ensure those requirements are understood and met. Producing a highly effective, high performance and safe product is paramount in our company. We have an excellent crew that works diligently to ensure that the fire fighter’s needs are met and that we keep up with demand year-round to help protect anything that lies in the path of a wild fire. We offer a full line of accessories and services, including working jointly with agencies and organizations who desire training, demonstrations, or product safety reviews.&lt;/p&gt;\n\n&lt;p&gt;These unrivaled characteristics have distinguished FireQuick Flare Systems as the preferred ignition choice of the United States Forest Service.&lt;/p&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n', '1', '1'),
(37, 'Careers', '&lt;div&gt;\n&lt;div&gt;\n&lt;div&gt;\n&lt;p&gt;Firequick Products offers a great place to work with a work-family culture. We are busy in production year-round serving the wild land fire management community. All jobs are at our facilities in the town of Inyokern, 12 miles from the city of Ridgecrest, California. We are a small business, offering competitive salaries, some benefits, and bonuses based on profitability. Here in the high-desert, we enjoy clean air, low crime, good schools, medical facilities, decent cost-of-living, and a wealth of outdoor recreational opportunities.&lt;/p&gt;\n\n&lt;p&gt;Currently we are recruiting for the following positions:&lt;/p&gt;\n\n&lt;p&gt;Production Crew Members: Firequick hires seasonal production workers every year beginning in the late spring. We utilize local temporary service agencies to hire these positions, typically starting at or above minimum wage. Typically, 4-6 temporary employees are maintained year-round and may end up as permanent hires the following season, based on performance. Ideal candidates are willing to be reliable, work hard and adhere to all production and safety policies. Interested candidates should contact Continental Labor or SASS in Ridgecrest, CA to apply.&lt;/p&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n', '1', '2'),
(38, 'TESTIMONIALS', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fortune5.pro/admin/assets/images/648a64bcc25548a6572075fd06c977b3.jpg&quot;&gt;&lt;/p&gt;\n\n&lt;table border=&quot;1&quot; cellpadding=&quot;1&quot; cellspacing=&quot;1&quot;&gt;\n &lt;tbody&gt;\n  &lt;tr&gt;\n   &lt;td&gt;\n   &lt;p&gt;&lt;p&gt;We have been using Firequick products for years including the launchers and hand thrown devices. We have used them for both wildland fire fighting operations and controlled burns because they work! The amount of time and energy they have saved my crew cannot be overemphasized. Thanks for a great product.&lt;/p&gt;&lt;/p&gt;\n\n   &lt;p&gt;&lt;p&gt;&lt;i&gt;Tim Walsh&lt;/i&gt; – Fire Crew Superintendent, Marin County Fire Department, Tamalpais Fire Crew&lt;/p&gt;&lt;/p&gt;\n   &lt;/td&gt;\n  &lt;/tr&gt;\n &lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fortune5.pro/admin/assets/images/bc481e78fd257ef50dd4cee8e720c582.jpg&quot;&gt;&lt;/p&gt;\n\n&lt;table border=&quot;1&quot; cellpadding=&quot;1&quot; cellspacing=&quot;1&quot;&gt;\n &lt;tbody&gt;\n  &lt;tr&gt;\n   &lt;td&gt;\n   &lt;div&gt;\n   &lt;div&gt;\n   &lt;p&gt;&lt;p&gt;I have been working with Firequick for a number of years and it has been a pleasure. The company delivers such outstanding customer service and has great products, made by reliable people.&lt;/p&gt;&lt;/p&gt;\n   &lt;/div&gt;\n   &lt;/div&gt;\n\n   &lt;div&gt;\n   &lt;div&gt;\n   &lt;p&gt;&lt;p&gt;&lt;i&gt;Louis Ermigarat&lt;/i&gt; – Fire Captain Training Bureau, CAL FIRE, San Luis Obispo County Fire&lt;/p&gt;&lt;/p&gt;\n   &lt;/div&gt;\n   &lt;/div&gt;\n   &lt;/td&gt;\n  &lt;/tr&gt;\n &lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fortune5.pro/admin/assets/images/e9dba48e5f7ba88b01317be0939c1b6f.jpg&quot;&gt;&lt;/p&gt;\n\n&lt;table border=&quot;1&quot; cellpadding=&quot;1&quot; cellspacing=&quot;1&quot;&gt;\n &lt;tbody&gt;\n  &lt;tr&gt;\n   &lt;td&gt;\n   &lt;p&gt;&lt;p&gt;I have hands-on experience with the Firequick production process. Their product quality and performance is second to none and the customer service is top-notch.&lt;/p&gt;&lt;/p&gt;\n   &lt;p&gt;&lt;i&gt;Mike Cooper&lt;/i&gt;&lt;/p&gt;&lt;/td&gt;\n  &lt;/tr&gt;\n &lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt; &lt;/p&gt;\n', '1', '1');
INSERT INTO `products` (`product_id`, `product_custom_order`, `title`, `sku`, `discripition`, `category_id`, `image_id`, `video`, `weight_lbs`, `height`, `width`, `length`, `size`, `color`, `regular_price`, `sale_price`, `tax`, `handling_fee`, `restricted_status`, `optional_info_discripition`, `item_marked`, `optional_info_status`, `status`, `deleted`) VALUES
(6, 20, '16 Large Format Flares in an Orange Utility Dry Box', NULL, 'A great side-kick to the Large Format Launcher, this strong ammo-style water-tight box provides an easy-to-carry, protective environment for your large-format flares.  The box contains 16 large format flares designed specifically for the large format launcher and is a handy alternative for carrying flares with you in the field as well as storing on your engine.', '3,5', '95b2f6657e4de907e8328e7cb2657400.jpg', NULL, '24', '23', '23', '23', '25', '#702020', 315.00, 0.00, 0.00, 0.00, 'not', NULL, '1', '2', '1', 0),
(17, 47, 'Double Pouch Speed Loader Case', 'a320f02404b649f1688fa823cb8033d7', 'This leather case can attach to any standard belt and be worn next to your FireQuick Holster. It can carry up to 4 speed loaders.\n***DISCONTINUED ITEM, LIMITED STOCK AVAILABLE***', '4', 'd3523cf23506d2ca3722f2451cf19ddf.jpeg', '', '1', '4', '4', '6', '', '', 25.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(18, 24, 'Large Format Initial Attack Kit', 'c26fed40efa3886b480df1d09fea6858', 'The Firequick Large Format Initial Attack Kit includes the large-format launcher and custom carry case, 2 each 10-round magazines, 2 boxes of 20 each 5.56 blanks, a custom Firequick large-format cleaning kit, and 16 each large-format flares in a water-tight, rugged, safety orange ammo box.', '2,5', 'b8a8da6b39d98379cc2de5b8122ded16.jpg', '', '21', '13', '6', '37', '', '', 1730.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(21, 28, 'Cartridge, #5 Red (box of 100 ea)', 'c7e034fb796b4f30f5f886ad3d9a9c5e', 'Winchester or Powers Industrial Load is used in the FireQuick Launchers for igniting and propelling the launch capable flares (Hotshot and Stubby). For optimal performance, it is recommended that the #6 (purple) be used. All cartridges come in boxes of 100 each.', '4', '69d70498c7f1f3ddf93ee83013478f72.jpg', '', '0.223', '2', '1.25', '2', '', '', 13.65, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(22, 27, 'Cartridges, # 6 Purple (box of 100ea) / NFES # 000372', '9f8e4c2994e299e41f4d48527f7a7178', 'Winchester or Powers Industrial Load is used in the FireQuick Launchers for igniting and propelling the launch capable flares (Hotshot and Stubby). For optimal performance, it is recommended that the #6 (purple) be used, although we offer #5 and #7 cartridges if desired. All cartridges come in boxes of 100 each.', '4', 'adc23bc7637bee25e852b410acf5fa63.jpg', '', '0.223', '.75', '2.5', '2.5', '', '', 16.45, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(24, 0, 'Spare Cylinder', 'a92c1f8c9c4570de84911c6e69210350', 'This 9-round cylinder fits the FireQuick Launchers I and II only.  A handy item to have for quick reloading and firing.\n***DISCONTINUED ITEM, OUT OF STOCK***', '4', 'e0fa33681967368035257ff3660a5b95.jpeg', '', '0.5', '4', '4', '6', '', '', 58.00, 0.00, 0.00, 0.00, 'not', '', '3', '2', '2', 1),
(25, 52, 'Firequick Launcher I Holster', 'd18537f2e825b599d87bc9127ab5bbc8', 'FireQuick Launcher Holsters provide protection to your launcher as well as enabling the user to carry the launcher on a belt.', '4', '54f8df0ba8c4ed6f03b2f7ff63b783c5.jpeg', '', '1', '4', '4', '6', '', '', 44.00, 0.00, 0.00, 0.00, 'not', '', '3', '2', '2', 1),
(26, 30, 'Firequick Launcher II or III Holster', '8fd1ef177400f60f384d9e3a65d03413', 'This belt-ready holster accommodates the Dual Launcher II and the Dual Launcher III with or without the Hotshot barrel adapter in place. There is a convenient outer pocket on the holster to carry your barrel adapter or a box of cartridges.', '4', '47af840ab23aec290c2d4ddfbed3bb6c.jpeg', '', '1', '4', '4', '6', '', '', 53.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(27, 62, 'Speed Loader', '49f4b3af6e4b673fd0a0faceb8d0df90', 'Currently available for the Launcher I and II only, this 9-round speed-loader allows you to quickly and easily reload your FireQuick Launcher. When time counts on the firing line, this item will be your new best friend! Purchase as many speed loaders as you need and load them up in advance, cartridges remain firmly locked in place until ready to use.\n***DISCONTINUED ITEM, OUT OF STOCK***', '4', 'afafbb256faaaf0f9db135ef21a267d7.jpeg', '', '0.5', '4', '4', '6', '', '', 18.00, 0.00, 0.00, 0.00, 'not', '', '3', '2', '2', 1),
(29, 35, 'Firequick Products User Training Workbook Hard Copy', '89ebcbcdf6ebe7b179c2044cf5e1c23b', 'Firequick Products offers a comprehensive User Training Workbook available as a hardcopy or a digital download. This workbook covers the flare and launcher specifications, field applications, field care and safety considerations, transportation, storage and handling recommendations and security concerns, as well as troubleshooting and disposal techniques. The workbook does not attempt to dictate firing or burn operation procedures, but is limited specifically to the product line use and safety. This workbook has been utilized successfully to support formal and informal firing operations training events. The hardcopy workbook is illustrated in color and comes in a soft protective report cover.', '4', '7226699767f20c521ca17e191698e576.jpg', '', '1', '4', '4', '6', '', '', 20.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(32, 6, 'Big Shot Flare, 1 Mini Case (20 flares) / NFES 000299', '26561bf2e221d8725a78f79efbf04c68', 'The Big Shot is a robust, hand-throw only flare that is extremely effective in medium to heavy and wet fuels. Burning material is sprayed up to 15 feet (4.5 meters) during initial jetting. This large and rugged flare is particularly good for tossing into deep culverts or other difficult terrain areas to safely start a fire without having to risk personnel hiking in. The Big Shot is also effective in starting a fire in slash piles, high canopy vegetation, etc.', '3', '82600d5549ab1e212080b20dbef7dfc2.jpeg', '', '23', '8', '10', '10', '', '', 375.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(33, 7, 'Big Shot Flare, 1 Case (50 flares)  / NFES 000299', 'a1ea2d92da4e5b8d6702fcd7c9ac9954', 'The Big Shot is a robust, hand-throw only flare that is extremely effective in medium to heavy and wet fuels. Burning material is sprayed up to 15 feet (4.5 meters) during initial jetting. This large and rugged flare is particularly good for tossing into deep culverts or other difficult terrain areas to safely start a fire without having to risk personnel hiking in. The Big Shot is also effective in starting a fire in slash piles, high canopy vegetation, etc.', '3', '85b738e47a70be0472e6b67b629b9f7b.jpeg', '', '57', '9', '14', '14', '', '', 930.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(35, 9, 'Chubbie Flare, 1 Mini Case (36 flares) / NFES 000690', '1b6f2a7d4365c064963281504d1059b2', 'The Chubbie is a lightweight, compact and extremely rugged hand-throw flare. This baseball size flare is easy to carry and easy to throw. It exhibits high-performance ignition capability in a variety of fuels and proves the perfect partner to the Stubby and Big Shot Flares.', '3', '7f8503132473c9fcb88fe8cf8e15b965.jpeg', '', '19', '8', '10', '10', '', '', 430.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(36, 10, 'Chubbie Flare, 1 Case (75 flares)  / NFES 000690', '067aa8784bd0ccee4fc5fd7a1dba8cdb', 'The Chubbie is a lightweight, compact and extremely rugged hand-throw flare. This baseball size flare is easy to carry and easy to throw. It exhibits high-performance ignition capability in a variety of fuels and proves the perfect partner to the Stubby and Big Shot Flares.', '3', '9556c6466f719a9df9a9ab6c5270179e.jpeg', '', '38', '7', '14', '14', '', '', 875.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(37, 8, 'Big Shot and Chubbie Combo Mini Case (12 Big Shots + 15 Chubbies)', 'dfc8616c7a74c106dccf3fe46d39672a', 'Buy both Firequick hand-thrown flares in this combo kit.', '3,5', 'fc4188da8dfdc00db99ebeb73766852b.jpeg', '', '21', '8', '10', '10', '', '', 416.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(38, 11, 'Hot Shot and Stubby Combo Mini Case (100 Hotshots+48 Stubbies)', '5f4d7eaa36503b5d64bfe4ec7ec097bb', 'Buy both Firequick mechanically-launched flares in this combo kit.', '3,5', '647375613072fedc35d98f2c396be309.jpeg', '', '20', '8', '10', '10', '', '', 1034.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(39, 12, 'Hotshot Flare 1 box (10 flares) / NFES 000371', '5ca96f61615d2b21c7ed7e4450442e7e', 'The Hotshot flare is a mechanically-launched, remote ignition flare, effective in light to medium fuels. This flare is often used in prescribed fire operations to burn off vast grassy or high weed areas. A 4-second delay allows placement of the flare 300-325 feet (90-100 meters) from the launch point before ignition. This flare is to be launched only and is NEVER to be ignited by hand; serious injury may occur if hand-ignition is attempted. A #6 cartridge is recommended for firing.', '3', '7224a8cce1ed8a0bcb04a776a5e3f040.jpeg', '', '0.925', '3.5', '1.75', '4.5', '', '', 70.80, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(40, 13, 'Hotshot Flare, 1 Mini Case (20 boxes/200 flares) / NFES 000371', 'b1afe5000e68622673a608d672f33ba9', 'The Hotshot flare is a mechanically-launched, remote ignition flare, effective in light to medium fuels. This flare is often used in prescribed fire operations to burn off vast grassy or high weed areas. A 4-second delay allows placement of the flare 300-325 feet (90-100 meters) from the launch point before ignition. This flare is to be launched only and is NEVER to be ignited by hand; serious injury may occur if hand-ignition is attempted. A #6 cartridge is recommended for firing.', '3', '43e9ff258237843f0858b88c5cd0457a.jpeg', '', '20', '8', '10', '10', '', '', 1396.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(41, 14, 'Hotshot Flare, 1 Case (40 boxes/400 flares)  / NFES 000371', 'f25c8ad97d84495121a56819c3a2f8ab', 'The Hotshot flare is a mechanically-launched, remote ignition flare, effective in light to medium fuels. This flare is often used in prescribed fire operations to burn off vast grassy or high weed areas. A 4-second delay allows placement of the flare 300-325 feet (90-100 meters) from the launch point before ignition. This flare is to be launched only and is NEVER to be ignited by hand; serious injury may occur if hand-ignition is attempted. A #6 cartridge is recommended for firing.', '3', '7f1e015e3c0abedb6a9fff682f698a7e.jpeg', '', '40', '15', '10', '10', '', '', 2690.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(42, 15, 'Stubby Flare, 1 box (12 flares) / NFES 000687', '576bfa51e540d3e180089914c65a314c', 'The Stubby is a launch-only flare to be fired from the FireQuick Dual Launcher II and III and packs more fire-power and demonstrates higher energy than ever before. This flare is a great choice for remote ignition in light to medium, and even damp fuels. Launch distance is 250-350 feet (76-107 meters) before ignition. This flare is to be launched only and is NEVER to be ignited by hand; serious injury may occur if hand-ignition is attempted. A #6 cartridge is recommended for firing.', '3', '87d8b73734f14e9545c52776c69f1706.jpg', '', '2', '3.5', '4.25', '4.5', '', '', 95.60, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(43, 16, 'Stubby Flare, 1 Mini Case(8 boxes/96 flares) / NFES 000687', '7dedb38d9f33366a4c20ffc8406c4638', 'The Stubby is a launch-only flare to be fired from the FireQuick Dual Launcher II and III and packs more fire-power and demonstrates higher energy than ever before. This flare is a great choice for remote ignition in light to medium, and even damp fuels. Launch distance is 250-350 feet (76-107 meters) before ignition. This flare is to be launched only and is NEVER to be ignited by hand; serious injury may occur if hand-ignition is attempted. A #6 cartridge is recommended for firing.', '3', '52dab34dbe2d056cbfeae48c6f6bafcf.jpg', '', '17', '8', '10', '10', '', '', 757.50, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(44, 17, 'Stubby Flare, 1 Case (25 boxes/300 flares)  / NFES 000687', 'fb3d8e800bd4644db3b0fa8f32e1e325', 'The Stubby is a launch-only flare to be fired from the FireQuick Dual Launcher II and III and packs more fire-power and demonstrates higher energy than ever before. This flare is a great choice for remote ignition in light to medium, and even damp fuels. Launch distance is 250-350 feet (76-107 meters) before ignition. This flare is to be launched only and is NEVER to be ignited by hand; serious injury may occur if hand-ignition is attempted. A #6 cartridge is recommended for firing.', '3', '72a68143645baf7f8d3936fc42cb33b2.jpg', '', '58', '22', '9', '11', '', '', 2350.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(45, 21, 'Firequick Flare Systems Launcher III / NFES #000571', 'c34bf9a6da5d5c039e6482b999b56dd7', 'The Dual Launcher III is designed to launch both the Hotshot and Stubby Flares and includes a 6-round, 22 caliber swing-out cylinder with a built-in casing ejector that removes all spent round casings in one easy action shot. Additionally, the trigger guard has been enlarged to more easily accommodate a gloved hand. The safety-orange grip attests to the “non-firearm” designation of this high-performance firefighting tool. *Please note: A #5 (red) or #6 (purple) Winchester/Olin or Powers industrial load is recommended for the Dual Launcher III, please see the Accessories page [please link to product on Accessories product page]. DO NOT use the #7 (grey) rounds or a Blue Point #6 round in the Dual Launcher III as these WILL damage the Launcher III cylinder and may result in a costly repair. Damage from the use of #7 load is evident and will void your warranty for any applicable repair.', '2', 'faa55345297afd4753275c90a06d3e70.jpeg', '', '4.4', '4', '10', '13', '', '', 895.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(46, 23, 'Initial Attack Kit with Launcher', 'f711418d89b7fd29c55587f4fea6e256', 'The Initial Attack Kit with Launcher  includes 1 Launcher III and holster, 3 boxes each Hotshot and Stubby flares, 1 box # 6 cartridges, and 1 Firequick launcher cleaning kit in rugged, water-tight, safety-orange ammo case.', '2,5', 'f1da5d445a5d5fd636ad9add8454e45e.jpeg', '', '20.8', '12', '12', '16', '', '', 1405.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(47, 25, 'Firequick Products Launcher Cleaning Kit', 'bf1ce74e1a762791ed91a2a55ee80f9a', 'The new Firequick Launcher Cleaning Kit contains all of the customized brushes, cleaners, lubricants, and other items, as well as instructions to keep any model FireQuick Launcher well maintained. All items come in a rugged PVC container designed to hold up in tough environments.', '4', '01bd3c343c807429c449cfac58a6be1a.jpg', '', '3', '4', '6', '12', '', '', 75.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(48, 33, 'Orange Watertight Utility Box Tall with Firequick Labels', '285c7ae231398f6fe98f8650c908a4ab', 'Rugged, water-tight safety-orange ammo box as used for our Initial Attack Kit. This empty box will allow you to arrange and store your FireQuick Flare Systems in a protective environment whether in storage or in transit. Size 15\" L x 7.75\" W x 11.5\" H', '4', '00348e5d74415dc80ee52bc46bf59481.jpeg', '', '3', '12', '12', '16', '', '', 52.00, 0.00, 0.00, 0.00, 'not', 'Tall', '1', '2', '1', 0),
(50, 34, 'Firequick User Training Workbook Digital Download', '8cd1d10a6e44464cc8723ef9ba0d04bc', 'The purpose of this workbook is as a training aid, specifically designed to educate potential FireQuick Flare System users in the appropriate and safe handling and function of each device in the FireQuick product line. The Manufacturer, Firequick Products, Inc. or its approved Distributors, if any, should be consulted for training and for information on use of this workbook as a training aid.', '4', 'b95ce9631905dde97191b8137eaacd89.png', '', '1', '1', '1', '1', '', '', 15.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(51, 18, 'Firequick Large Format Flare Mini Case (24 Flares)', '6684d15faba519ad69a22c3b42af1f5f', 'The partner flare to the Large Format Launcher is the yellow Large-Format Flare, a mechanically launch-only flare, created to balance weight, flight and fire performance. Firequick designed this flare in response to the need to get the higher fire power of our large flares a distance further than they can be thrown by hand. Like our other flares, it is robust and includes a delayed remote ignition, a simple and reliable design, and an added tension dot on the side of flare to keep the flare from falling easily out of the barrel if the launcher is pointed down. The large format flare can be propelled approx. 200 feet (61 meters) from the firing point or can be used to run a precise ribbon of fire across a field from a level firing position. 4000° F burning material is sprayed up to 15 feet (4.5 meters) during initial jetting.', '3', '2da159d45f8ecbe3f96cb3557782c725.png', '', '18', '11', '8', '11', '', '', 375.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(52, 19, 'Firequick Large Format Flare Case (50 Flares)', 'c83d212e7e75ef74296360f956b9d1f2', 'The partner flare to the Large Format Launcher is the yellow Large-Format Flare, a mechanically launch-only flare, created to balance weight, flight and fire performance. Firequick designed this flare in response to the need to get the higher fire power of our large flares a distance further than they can be thrown by hand. Like our other flares, it is robust and includes a delayed remote ignition, a simple and reliable design, and an added tension dot on the side of flare to keep the flare from falling easily out of the barrel if the launcher is pointed down. The large format flare can be propelled approx. 200 feet (61 meters) from the firing point or can be used to run a precise ribbon of fire across a field from a level firing position. 4000° F burning material is sprayed up to 15 feet (4.5 meters) during initial jetting.', '3', '124c05a1182ca5286f30eb0189318f59.png', '', '40', '14', '14', '11', '', '', 765.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
(53, 22, 'Firequick Large Format Launcher', '2b7a39511add2bfbc8ffb411ceff3b95', 'The much-anticipated Large Format Launcher (LFL) is now available for purchase! The LFL has been specially designed to project a large-format flare approx. 200 feet from the user. Whether you need to put larger firepower further out or would like to lay a precise ribbon of fire across a field, this is the launcher for you! Based on an M4 rifle platform, the launcher helps the user withstand the recoil from propelling larger flares into the field. This launcher uses .223/5.56 blanks only, which are available for sale in the Accessories section. The launcher comes with a soft padded rifle case with multiple accessory pockets, and an LFL modified magazine.', '2', 'af0f122495eb1ae883d4fdab75839111.png', '', '13', '6', '13', '37', '', '', 1420.00, 0.00, 0.00, 0.00, 'not', '', '1', '2', '1', 0),
