(82, 56, 'WILEY X DEAL OF THE DAY', 'ae22190ed00ff23833d0b9c6e748a639', 'Todays Deal of the Day are the Wiley X KINGPIN. \nPolarized Venice Gold Lenses, Matte Black Frame.\nLightweight frame\nMeets or exceeds ANSI Z87.1 industrial standards for high-mass and high-velocity impact protection.\n100% UVA/UVB protection with distortion free clarity.', '6', 'c79af76e177c9cd74e0a926f3dfc124a.jpg', '', '1', '12', '6', '4', '', '', 91.00, 0.00, NULL, 0.00, 'not', '', '1', '2', '2', 1),
(83, 58, 'Wiley X ARROW CCARR11, Polarized Yellow Lenses / Matte Black Frame', 'af60343637443f42a42ebb04d302f2d4', 'The Wiley X Arrow Polarized Sunglasses are designed to fit small to medium heads comfortably and provide benchmark levels of impact protection and visual clarity. The shatterproof Selenite® polycarbonate lenses meet OSHA 1910.133(b)(1)(1) and ANSI Z87.1-2010 high velocity and high mass impact standards, while guaranteeing complete UVA and UVB protection to preserve eye health. The tough T-Shell® coating prevents scratching, maintaining vision clarity and lasting service life. The Arrow\'s polarized yellow color is optimized for low-light conditions and prevents blinding glare. Its durable, lightweight frames feature a removable Facial Cavity™ that prevents peripheral glare as well as blocks out dust and debris, further protecting the eyes. The sunglasses include a leash cord for retention, a microfiber cleaning cloth and a zippered clamshell case for safe storage and transport.', '6', 'f98b67614a8cb47cf3e798b9d82f8cd3.jpg', '', '1', '12', '6', '4', 'Size', '', 150.00, 75.00, NULL, 0.00, 'not', '', '1', '2', '2', 1),
(84, 40, 'Wiley X ECHO CCECH04, Polarized Emerald Mirror Lenses / Black Gloss Frame', '720bf181d2e9612551dad4ffce051560', 'Shield your eyes from glare and protect them from impacts with the Echo Pol Sunglasses with emerald mirror lenses and gloss black frames from Wiley X. The Selenite polarized polycarbonate lenses meet ANSI Z87.1-2010 and OSHA 1910.133(b)(1)(1) safety standards, and provide 100% protection from UVA and UVB radiation. They\'re designed to amplify color contrast and deliver high visual definition. The removable Facial Cavity Seal protects your eyes from fine dust, pollen, irritants and peripheral light.\n\nMeets ANSI Z87.1-2010 & OSHA 1910.133(b)(1)(1) safety standards\nRemovable Facial Cavity Seal protects eyes from fine dust, pollen, irritants & peripheral light\nWiley X Selenite polarized polycarbonate lenses with T-Shell scratch-resistant coating\n100% protection from UVA and UVB radiation\nLens width 2.7\" / 68 mm; bridge size 0.7\" / 18 mm; temple size 4.5\" / 115 mm\nComes with black zippered clamshell case, leash cord with rubber temple grips, microfiber cleaning cloth', '6', '72e65cc322651a0fb5995980d61c58d2.jpg', '', '1', '12', '6', '4', '', '', 150.00, 75.00, NULL, 0.00, 'not', '', '1', '2', '2', 1),
(85, 57, 'Wiley X KNIFE CCKNI01, Grey Lens / Matte Black Frame', '817b62b8f3019ab20b1b2bbd39afc83c', 'Black Ops-Limited Edition. 100% UV Protection. The Smoke Grey lens provides maximum glare reduction. Won’t distort colors and the function is excellent in bright and glare conditions. Light transmission: 15%. Meets or exceeds (US.) ANSI Z87.1 High Velocity impact safety and optical standards. Certified and tested accordingly to the EN.166 (F) norm – EU. Personal Eye-Protection Standard. Eye-Protection Category: Low energy impact - Spectacles. Our patented removable Facial Cavity Seal Blocks out wind, debris and peripheral light. Wiley X frames can be filled with a prescription safety lens that meets the on-duty and battlefield safety requirements. The RX RIM system brings prescription lens possibilities to the NeXT level, by extenting lens power capabilities further than the traditional RX Lens limitations. Top down™ ventilation for fog free environment. Multi-layer foam for added comfort and protection. Designed for medium-large faces.', '6', 'f722390b064925fec07802fe443894cb.jpg', '', '1', '12', '6', '4', '', '', 100.00, 50.00, NULL, 0.00, 'not', '', '1', '2', '2', 1),
(86, 5, 'Orange Watertight Utility Box Small with Firequick Labels', 'f0b37ffe66e50c016090c420c731ffb2', 'Rugged, water-tight safety-orange ammo box as used for our LIII Kit. This empty box will allow you to arrange and store your FireQuick Flare Systems in a protective environment whether in storage or in transit. Size 15\" L x 7.75\" W x 6.5\" H', '4', '165a9cb6048b4005514c90a5ca9be351.jpg', '', '4', '16', '12', '8', 'Small', 'Orange', 40.00, 0.00, NULL, 0.00, 'not', 'Size Small', '1', '2', '1', 0),
(87, 4, 'Orange Watertight Utility Box Large with Firequick Labels', '7107c514692c270785c2bfc6c867a2df', 'Rugged, water-tight safety-orange ammo box as used for our Firing Operations Kit. This empty box will allow you to arrange and store your FireQuick Flare Systems in a protective environment whether in storage or in transit. Size 15\" L x 8.75\" W x 9.5\" H', '4', 'e9aa8995580da909ae2dc3a6f296bf91.jpg', '', '6', '16', '12', '12', 'Large', 'Orange', 54.00, 0.00, NULL, 0.00, 'not', 'Size Large', '1', '2', '1', 0),
(88, 65, 'Mystery Ranch Go Deep Sling', 'eb2a6682c9713387974d9d97e753ea27', 'The MYSTERY RANCH GO DEEP SLING is a fully-featured firing bag designed to accommodate everything you need for firing operations. The adjustable shoulder strap easily slings over the shoulder and doubles as a bandolier for carrying extra rounds. The shoulder strap is removable for operating out of a vehicle, etc. The main zippered compartment comes with a reloading accessory bag to easily swap in/out additional flares. The pack features two large zippered compartments for Launcher and accessory carry and also has smaller zippered compartments at each end for carrying cartridges. Built with burly 500D CORDURA® fabric and rugged YKK® zippers, this firing bag is built for many missions.  Please note that the Hotshot Flares are NOT included,  picture shown is for demonstration purposes only.', '4', 'd80b80ca541f79bb47a12359f73d0704.jpg', '', '4', '16', '12', '8', '', '', 129.00, 0.00, NULL, 0.00, 'not', '', '1', '2', '1', 0),
(89, 63, 'Firequick Firing Operations Kit', '7693fccfb99c68ff8e31a9d87ed0a7f8', 'The Firequick Products Firing Operations Kit provides a rugged and watertight solution for\nyour flare carrying needs while conducting firing operations. The kit contains 100 Hotshot\nflares and 48 Stubby flares that can be carried using the included Mystery Ranch Go Deep\nand Reload pouches along with a bandolier. The bandolier is capable of holding 20 Hotshot\nflares, allowing the pouches to be shoulder slung for easy access. The kit also provides two\nlarge Firequick branded safety orange watertight utility boxes that the loaded pouches can\nbe securely, and weather protectively stored in until they are needed. This kit is your ready\nto go firing operations solution that will improve your team’s operational effectiveness.', '3,5', '972ccc487e8551cc4b38dbd9fca4dc16.png', '', '31', '36', '12', '12', '', '', 1150.00, 0.00, NULL, 0.00, 'not', '', '1', '2', '1', 0),
(90, 64, 'Firequick Launcher III Kit', 'b3a91ce9f60a78f1d77d6f0ebea33bcd', 'The Firequick Products Launcher III Kit provides the Launcher III with holster\nand cartridges needed to fire both the Firequick Hotshot and Stubby flares.\nAlso included is a custom cleaning kit so your launcher can be kept in a well maintained\ncondition. The kit is supplied within a small Firequick branded\nsafety orange watertight utility box that provides a rugged and watertight\nsolution for storing your kit when not in use.', '2,5', '01b940db938176f71efabce15b483c3e.jpg', '', '10', '16', '12', '8', '', '', 995.00, 0.00, NULL, 0.00, 'not', '', '1', '2', '1', 0);
INSERT INTO `products` (`product_id`, `product_custom_order`, `title`, `sku`, `discripition`, `category_id`, `image_id`, `video`, `weight_lbs`, `height`, `width`, `length`, `size`, `color`, `regular_price`, `sale_price`, `tax`, `handling_fee`, `restricted_status`, `optional_info_discripition`, `item_marked`, `optional_info_status`, `status`, `deleted`) VALUES
(91, 1, 'Large Format Launcher Stubby Adapter Kit', 'f1656a701bc709622dce211f4ed9701b', 'Elevate your Large Format Launcher’s (LFL) capability to the next level with the Stubby Adapter.  The Stubby Adapter turns your LFL into a multi-flare launcher system giving you the option to also fire Stubby flares! The LFL Stubby Adapter will increase your stubby flare travel distance to approx. 400 feet and is particularly effective if you need to fire into a headwind. The Stubby Adapter simply screws into a newly designed threaded gas port, making changing between Large Format Flares and Stubby Flares a quick and easy process.\n***The Stubby Adapter’s new threaded gas port is already installed from Launcher Serial Number 20150 onwards.  ALL Launcher Serial Numbers preceding 20150 will require the Conversion Kit***', '2,4', '69d08e5ec1b6f877835c150665a311a7.jpg', '', '2', '3', '3', '18', '', '', 265.00, 0.00, NULL, 0.00, 'not', '', '1', '2', '1', 0),
(92, 2, 'Large Format Launcher Stubby Conversion Kit', 'e4e8659056ed32d31cfdf0e16e49dd49', 'Firequick Products are excited to offer an OEM upgrade to our Large Format Launcher (LFL).  The Stubby Adapter Conversion Kit turns your early production LFL into a multi-flare launcher by replacing the original gas port with a threaded gas port that will accept our new LFL Stubby Adapter and allow you to fire both Large Format Flares and Stubby Flares.  The conversion can only be completed by our skilled on-site technicians who will dismantle your LFL, replace the gas port, reassemble, and then complete all functional and live firing tests to ensure you receive back a fully functioning LFL and Stubby Adapter.\n***The Stubby Adapter’s new threaded gas port is already installed from Launcher Serial Number 20150 onwards.  ALL Launcher Serial Numbers preceding 20150 will require the Conversion Kit***', '2,4', '214fb15bb9ff1810ba7c45c2a4b903d3.jpg', '', '21', '13', '6', '37', '', '', 530.00, 0.00, NULL, 0.00, 'not', '', '1', '2', '1', 0),
(93, 3, 'Large Format Launcher Stubby Adapter Push Rod', 'c1b5fa20d49cb0cab5ca9372a28c7744', 'The Large Format Launcher Stubby Adapter is supplied with a Push Rod to ensure easy and correct seating of the Stubby Flare within the adapter.  The Push Rod has been designed to be lightweight, strong, and storable inside the launcher barrel.  If you need a replacement, they can be ordered individually.', '2,4', '67c50855a64e33261b2e4d2f0f45541d.jpg', '', '1', '6', '6', '4', '', '', 15.00, 0.00, NULL, 0.00, 'not', '', '1', '2', '1', 0);
