INSERT INTO `safety_training_videos` (`id`, `description`, `youtube_title`, `youtube_url`) VALUES
(1, 'Firequick Products, Inc. is committed to user safety. The instructional videos below cover our 3 different flare systems: Hand Thrown Flares, Large Format Launcher, and Launcher III. They include a full explanation of each flare system with a field firing demonstration demonstrating correct firing techniques. If you are new to our products or have crew members who you want to familiarize our products with before using them in a live situation, these are the videos for you!  ', 'a:3:{i:0;s:28:\"Large Format System Launcher\";i:1;s:20:\"LIII System Launcher\";i:2;s:18:\"Hand Thrown Flares\";}', 'a:3:{i:0;s:50:\"https://www.youtube.com/watch?v=OduA6ghsXMM&t=192s\";i:1;s:50:\"https://www.youtube.com/watch?v=qMfx4ajQu34&t=104s\";i:2;s:50:\"https://www.youtube.com/watch?v=H-U0a4AAZig&t=164s\";}');
