INSERT INTO `testimonials` (`testimonial_id`, `author`, `discripition`, `image_id`) VALUES
(1, 'Tim Walsh – Fire Crew Superintendent, Marin County Fire Department, Tamalpais Fire Crew', 'We have been using Firequick products for years including the launchers and hand thrown devices. We have used them for both wildland fire fighting operations and controlled burns because they work! The amount of time and energy they have saved my crew cannot be overemphasized. Thanks for a great product.', 'a45be115dcea08f49f7a7e38a0432ab2.jpg'),
(3, 'Louis Ermigarat – Fire Captain Training Bureau, CAL FIRE, San Luis Obispo County Fire', 'I have been working with Firequick for a number of years and it has been a pleasure. The company delivers such outstanding customer service and has great products, made by reliable people.', '20b3ad47bde34a5b18be4a9867263548.jpg'),
(4, 'Mike Copper', 'I have hands-on experience with the Firequick production process. Their product quality and performance is second to none and the customer service is top-notch.', 'ec50eb8024ed9de4259697d07b33401e.jpg');
